grid = [list(rows) for rows in grid]


directions = [
    (-1,-1),(-1,0),(-1,1), #up
    (0,-1), (0,1), #mid
    (1,-1),(1,0),(1,1) #down
]

high = len(grid)
length = len(grid[0])
answer = 0

while True:
    need_remove = []
    for row in range(high):
        for column in range(length):
            if grid[row][column] == ".":
                continue

            neighbors = 0

            for x, y in directions:
                new_row = row+x
                new_column = column+y

                if 0 <= new_row < high and 0 <= new_column < length:
                    if grid[new_row][new_column] == "@":
                        neighbors+=1

            if neighbors < 4:
                need_remove.append((row,column))


    if not need_remove:
        break

    answer+=len(need_remove)

    for r, c in need_remove:
        grid[r][c] = "."

print(answer)